import React, { Fragment, useState,useEffect } from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { logout } from "../../actions/auth";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Form from "react-bootstrap/Form";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import logo from "../../images_files/logo1.jpg";
const NavbarHeader = ({ auth: { isAuthenticated, loading }, logout }) => {



  const [categoryNames, setcategoryNames] = useState("");

  useEffect(()=>{
   const fetchCatecoryName=async()=>{
      const resp=await fetch("http://localhost:5000/Fetch-Categories");
      const json=await resp.json()
      if(resp.ok){
        setcategoryNames(json);
      }
   }

   fetchCatecoryName()
 }, [])







	const authLinks = (
		<ul className="nav-links list-unstyled" >
			<li className="list-inline-item">
				<Link to="/dashboard">
					<i className="fas fa-user"></i>{" "}
					<span className="hide-sm">Dashboard</span>
				</Link>
			</li>
			<li className="list-inline-item">
				<Link onClick={logout} to="/" replace>
					<i className="fas fa-sign-out-alt"></i>{" "}
					<span className="hide-sm"> &nbsp;Logout</span>
				</Link>
			</li>
		</ul>
	);
	const guestLinks = (
		<div className="container-fluid">
            <div className="row navbar-part p-2 m-0">
              <div className="col-md-12" align="center">
                <Navbar bg="" expand="lg" >
                  <Container fluid>
                    <Navbar.Brand href="/">
                      <img className="logo" src={logo} alt="Florida Fashion" />
                    </Navbar.Brand>
                    <Navbar.Toggle aria-controls="navbarScroll" />
                    <Navbar.Collapse id="navbarScroll">
                      <Nav
                        className="me-auto my-2 my-lg-0"
                        style={{ maxHeight: "100px" }}
                        navbarScroll
                      >
                        <Nav.Link href="/">Home</Nav.Link>
                        <Nav.Link href="/register">Sign Up</Nav.Link>
                        <Nav.Link href="login">Sign In</Nav.Link>
                        <Nav.Link href="/">Cart</Nav.Link>
                        <NavDropdown title="More" id="navbarScrollingDropdown">
                          <NavDropdown.Item href="#action3">
                            Home
                          </NavDropdown.Item>
                          <NavDropdown.Item href="#action4">
                            About Us
                          </NavDropdown.Item>
                          <NavDropdown.Item href="#action5">
                            Contact Us
                          </NavDropdown.Item>
                        </NavDropdown>

                        <NavDropdown
                          title="Browse Category"
                          id="navbarScrollingDropdown"
                        >
                          {categoryNames && categoryNames.map((category)=>(
    <NavDropdown.Item key={category._id} value={category.category_name}>{category.category_name}</NavDropdown.Item>
  ))}
                        </NavDropdown>
                      </Nav>
					  <Form className="d-flex justify-content-end">
                        <Form.Control
                          type="search"
                          placeholder="Search"
                          className="me-2"
                          aria-label="Search"
                        />
                        <Button variant="">
                          <i className="fa fa-search"></i>
                        </Button>
                      </Form>                    
                    </Navbar.Collapse>
                  </Container>
                </Navbar>
              </div>
            </div>
          </div>
	);

	return (
		<nav className="navbar ">
			{!loading && (
				<Fragment>{isAuthenticated ? authLinks : guestLinks}</Fragment>
			)}
		</nav>
	);
};

NavbarHeader.propTypes = {
	logout: PropTypes.func.isRequired,
	auth: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
	auth: state.auth,
});

export default connect(mapStateToProps, { logout })(NavbarHeader);
